import React, { Component } from 'react'

export default class Mark extends Component {
    constructor(props){
        super(props);
        this.state= {
            mrole: this.props.roll
        }
    }
    render() {
        return (
        <>
        <h1>Roll : {this.state.roll}</h1>
        </>
        )
    }
}
